<?php

$x = 0;
$y = 0;
$instructions = [
    '',
    '',
    '',
    '',
    ''
];
$keypad['-1/1'] = 1;
$keypad['0/1'] = 2;
$keypad['1/1'] = 3;
$keypad['-1/0'] = 4;
$keypad['0/0'] = 5;
$keypad['1/0'] = 6;
$keypad['-1/-1'] = 7;
$keypad['0/-1'] = 8;
$keypad['1/-1'] = 9;

foreach ($instructions as $instruction) {
    foreach (str_split($instruction) as $direction) {
        if ($direction == 'L') {
            $x -= 1;
        } elseif ($direction == 'R') {
            $x += 1;
        } elseif ($direction == 'U') {
            $y += 1;
        } elseif ($direction == 'D') {
            $y -= 1;
        }

        if ($x > 1) {
            $x = 1;
        }
        if ($x < -1) {
            $x = -1;
        }
        if ($y > 1) {
            $y = 1;
        }
        if ($y < -1) {
            $y = -1;
        }
    }
    echo $keypad[$x . '/' . $y];
}


